#
# TABLE STRUCTURE FOR: EQUIPE
#

DROP TABLE IF EXISTS `EQUIPE`;

CREATE TABLE `EQUIPE` (
  `Nome` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `Codigo` int(11) NOT NULL,
  `Vitorias` int(11) NOT NULL,
  `Empates` int(11) NOT NULL,
  `Derrotas` int(11) NOT NULL,
  PRIMARY KEY (`Codigo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


#
# TABLE STRUCTURE FOR: JOGADOR
#

DROP TABLE IF EXISTS `JOGADOR`;

CREATE TABLE `JOGADOR` (
  `CPF` int(11) NOT NULL,
  `Nome` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `DataNascimento` date NOT NULL,
  `DataContratacao` date NOT NULL,
  `Salario` float NOT NULL,
  `ECodigo` int(11) NOT NULL,
  PRIMARY KEY (`CPF`),
  KEY `ECodigo` (`ECodigo`),
  CONSTRAINT `JOGADOR_ibfk_1` FOREIGN KEY (`ECodigo`) REFERENCES `EQUIPE` (`Codigo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: POSICAO
#

DROP TABLE IF EXISTS `POSICAO`;

CREATE TABLE `POSICAO` (
  `Posicao` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `JCPF` int(11) NOT NULL,
  PRIMARY KEY (`Posicao`,`JCPF`),
  KEY `JCPF` (`JCPF`),
  CONSTRAINT `POSICAO_ibfk_1` FOREIGN KEY (`JCPF`) REFERENCES `JOGADOR` (`CPF`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: PARTIDA
#

DROP TABLE IF EXISTS `PARTIDA`;

CREATE TABLE `PARTIDA` (
  `Codigo` int(11) NOT NULL,
  `Data` date NOT NULL,
  `Local` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `Rodada` int(11) NOT NULL,
  `Publico` int(11) NOT NULL,
  `MGols` int(11) NOT NULL,
  `VGols` int(11) NOT NULL,
  `MECodigo` int(11) NOT NULL,
  `VECodigo` int(11) NOT NULL,
  PRIMARY KEY (`Codigo`),
  KEY `MECodigo` (`MECodigo`),
  KEY `VECodigo` (`VECodigo`),
  CONSTRAINT `PARTIDA_ibfk_1` FOREIGN KEY (`MECodigo`) REFERENCES `EQUIPE` (`Codigo`),
  CONSTRAINT `PARTIDA_ibfk_2` FOREIGN KEY (`VECodigo`) REFERENCES `EQUIPE` (`Codigo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: JOGA
#

DROP TABLE IF EXISTS `JOGA`;

CREATE TABLE `JOGA` (
  `Assistencias` int(11) NOT NULL,
  `Gols` int(11) NOT NULL,
  `CartoesAmarelos` int(11) NOT NULL,
  `CartaoVermelho` int(11) NOT NULL,
  `JCPF` int(11) NOT NULL,
  `PCodigo` int(11) NOT NULL,
  PRIMARY KEY (`JCPF`,`PCodigo`),
  KEY `PCodigo` (`PCodigo`),
  CONSTRAINT `JOGA_ibfk_1` FOREIGN KEY (`JCPF`) REFERENCES `JOGADOR` (`CPF`),
  CONSTRAINT `JOGA_ibfk_2` FOREIGN KEY (`PCodigo`) REFERENCES `PARTIDA` (`Codigo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;





